function: "This is my first ever medium scale RC aircraft so I decided to try to make it durable and easy to repair.  \n\nThe base frame is 3/4 inch aluminum square tubing to create the X and all other support pieces are printed ABS.  \n\nUsing MultiWii platform: http://www.multiwii.com/  \n\nLoosely based upon these videos:  \nhttp://www.youtube.com/watch?v=7DHoLYf5pMA  \n\nVideo of it in flight:  \nhttp://www.youtube.com/watch?v=Z1z6sDt9_qk  \n\nUpdate 8/30/2013, added FPV components.  \n\nLighter weight version using Poplar Squares here:  \nhttp://www.thingiverse.com/thing:143330"
